pragma solidity ^0.8.7;

interface ISoulLinker {
    struct Link {
        address sourceContract;
        uint256 sourceId;
        address targetContract;
        uint256 targetId;
    }

    function hasLinks(address token, uint256 tokenId) external returns (bool);
}
